import React, { useState } from 'react';
import './style.css';

const SubmitCar = () => {
  // State to hold current form input values
  const [carData, setCarData] = useState({
    make: '',
    model: '',
    year: '',
    price: '',
  });

  // State to hold the list of submitted cars
  const [carList, setCarList] = useState([]);

  // Handle input field changes
  const handleChange = (e) => {
    setCarData({
      ...carData,
      [e.target.name]: e.target.value,
    });
  };

  // Handle form submission
  const handleSubmit = (e) => {
    e.preventDefault();

    // Log the submitted car data to console
    console.log('Submitting Car:', carData);

    // Add the submitted car to the list
    setCarList([...carList, carData]);

    // Reset the form fields after submission
    setCarData({
      make: '',
      model: '',
      year: '',
      price: '',
    });
  };

  return (
    <div className="container">
      <h2 className="dashboard-title">Submit a Used Car</h2>

      {/* Car submission form */}
      <form onSubmit={handleSubmit}>
        <div className="form-group">
          <label htmlFor="make">Car Make</label>
          <input
            className="form-input"
            type="text"
            id="make"
            name="make"
            value={carData.make}
            onChange={handleChange}
          />
        </div>

        <div className="form-group">
          <label htmlFor="model">Model</label>
          <input
            className="form-input"
            type="text"
            id="model"
            name="model"
            value={carData.model}
            onChange={handleChange}
          />
        </div>

        <div className="form-group">
          <label htmlFor="year">Year</label>
          <input
            className="form-input"
            type="text"
            id="year"
            name="year"
            value={carData.year}
            onChange={handleChange}
          />
        </div>

        <div className="form-group">
          <label htmlFor="price">Price</label>
          <input
            className="form-input"
            type="text"
            id="price"
            name="price"
            value={carData.price}
            onChange={handleChange}
          />
        </div>

        {/* Submit button */}
        <button className="primary-button" type="submit">
          Submit
        </button>
      </form>

      {/* Display the list of submitted cars */}
      {carList.length > 0 && (
        <div style={{ marginTop: '30px' }}>
          <h3>Submitted Cars:</h3>
          <ul className="dashboard-links">
            {carList.map((car, index) => (
              <li key={index}>
                {car.make} {car.model} ({car.year}) â€“ ${car.price}
              </li>
            ))}
          </ul>
        </div>
      )}
    </div>
  );
};

export default SubmitCar;
